      name: "Aparthotel Stare Miasto",
      city: "Madrid",
      price: 120,
      rate: 8.9,
      type: "Excellent",
      image_url: "./images/hotel_1.webp",
    },
    {
      name: "Comfort Suites Airport",
      city: "Austin",
      price: 140,
      rate: 9.3,
      type: "Exceptional",
      image_url: "./images/hotel_2.jpg",
    },
    {
      name: "Four Seasons Hotel",
      city: "Lisbon",
      price: 99,
      rate: 8.8,
      type: "Excellent",
      image_url: "./images/hotel_3.jpg",
    },
    {
      name: "Hilton Garden Inn",
      city: "Berlin",
      price: 105,
      rate: 8.9,
      type: "Excellent",
      image_url: "./images/hotel_4.jpg",
    },
  ];
  const SearchHotel = () => {
    window.location.replace("/detail");
  };
  return (
    <div className="class-list1">
      <h2 className="conten3a">Homes guests love</h2>
      <div className="conten3b">
        {array3.map((array3, index) => (
          <div className="conten3c">
            <img
              className="conten3d"
              src={array3.image_url}
              alt={array3.index}
            />
            <h4 className="conten3e" onClick={SearchHotel}>
              {array3.name}
            </h4>
            <h4 className="conten3f">{array3.city}</h4>
            <h4 className="conten3g">
              Starting from
              <>{""}</> <span>${array3.price}</span>
            </h4>
            <h5 className="conten3h">
              <li> {array3.rate}</li>+<li> {array3.type}</li>
            </h5>
          </div>
        ))}
      </div>
    </div>
  );
};
export default Hotels;
